import PropTypes from 'prop-types';

const CommentList = ({value}) => {
    return(
        <>
            <div>{value}</div>
            {value.User.nickname && <div> 댓글 작성자 : {value.User.nickname}</div>}
            {value.content && <div>댓글 내용 : {value.content}</div>}
            {value.createdAt && <div>댓글 작성 시간 : {value.createdAt.substr(0,10)}</div>}
        </>
    );
};

CommentList.prototype = {
    comment : PropTypes.array.isRequired
}

export default CommentList;
